from typing import List

class Solution:
    def runningSum(self, nums: List[int]) -> List[int]:
        print("Input: nums = ", nums)
        i = 1
        while i<len(nums):
            nums[i]+=nums[i-1]
            i+=1
        print("Output: ", nums)
        return nums

example = Solution()
outlist = example.runningSum([1, 2, 3, 4])
print(outlist)
outlist = example.runningSum([1, 1, 1, 1])
print(outlist)
